def anagram(s):

    if len(s)%2!=0:
        return -1
    else:
        s1=s[0:(len(s)//2)]
        s2=s[(len(s)//2):len(s)]
        posi=[]
        posj=[]
        count=0
        for i in range(0,len(s1)):
            for j in range(0,len(s1)):
                if s1[i]==s2[j] and not (i in posi) and not (j in posj):
                    count+=1
                    posi.append(i);
                    posj.append(j);
                    break
                    
            
        return len(s1)-count

print(anagram(""))